        /// </summary>
        [JsonPropertyName("need_supply")]
        public bool NeedSupply { get; set; }

        /// <summary>
        /// 蚂蚁通行证安全密码，通过RSA加密传输,示例：b111111:
        /// </summary>
        [JsonPropertyName("security_password")]
        public string SecurityPassword { get; set; }

        /// <summary>
        /// 注册来源场景，shangshu_register--上树对接蚂蚁通行证，该场景登录号、登录密码、用户类型为必传参数
        /// </summary>
